import React from 'react';
import '../App.css';
import './ScrollContainer.scss';
import ViewTwoColumn from './ViewTwoColumn';
import Dawn from '../photos/Dawn-Yosemite.jpg';
import Daybreak from '../photos/Daybreak-HalfDome.jpg';
import Daytime from '../photos/Daytime-Beach.jpg';
import EveningRock from '../photos/Evening-Rock.jpg';
import EveningBeach from '../photos/Evening-Beach.jpg';
import SunsetWaves from '../photos/Sunset-Waves.jpg';
import Dusk from '../photos/Dusk-ElCapitan.jpg';
import Home from '../photos/Home.jpg';
import Placeholder from '../photos/placeholder.png';

function ScrollContainer() {
    return (
        <div className="texture-overlay">
            <div className="Scroll-Container">
                <div className="section first">
                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={Dawn}
                             alt="Dawn at Yosemite, the sunlight streaming through the valley."/>
                        <figcaption>Dawn at Yosemite</figcaption>
                    </figure>
                </div>
                <div className="section second">

                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={Daybreak}
                             alt="Daybreak at Half-Dome, the warm sun rising behind the peak."/>
                        <figcaption>
                            Daybreak at Half-Dome
                        </figcaption>
                    </figure>
                </div>
                <div className="section third">
                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={Daytime}
                             alt="Daytime at the beach, somewhere on the north-western coast of California."/>
                        <figcaption>
                            Daytime at a beach, somewhere on the north-western coast of California
                        </figcaption>
                    </figure>
                </div>
                <div className="section fourth">
                    <div className="two-columns">
                        <figure>
                            <img loading="lazy" src={Placeholder} data-src={EveningRock}
                                 alt="Evening shot of a rock in the ocean."/>

                            <img loading="lazy" src={Placeholder} data-src={EveningBeach}
                                 alt="Evening shot of the waves receding on the beach."/>
                            <figcaption>
                                Evening at the beach
                            </figcaption>
                        </figure>
                    </div>
                </div>
                <div className="section fifth">
                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={SunsetWaves}
                             alt="The waves crashing onto a beach at sunset."/>
                        <figcaption>
                            Sunset
                        </figcaption>
                    </figure>
                </div>
                <div className="section sixth">
                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={Dusk}
                             alt="El Capitan in all its glory at dusk."/>
                        <figcaption>
                            Dusk at El Capitan
                        </figcaption>
                    </figure>
                </div>
                <div className="section home">
                    <figure>
                        <img loading="lazy" src={Placeholder} data-src={Home}
                             alt="A dusky-pink sky outside the window, framed by a disco ball and windchimes."/>
                        <figcaption>
                            Home sweet home
                        </figcaption>
                    </figure>
                </div>
                <div className="footer">
                    <p>All photos captured with Nikon N8008 on film, 35mm lens.</p>
                </div>
            </div>
        </div>
    );
}

export default ScrollContainer;
